<script type="text/javascript">
    /*属性的简洁表示方法*/
    function getPoint() {
        var x = 1;
        var y = 10;

        return {x, y};
    }
    /*Object.is()
    * Object.is() 用来比较两个值是否严格相等。它与严格比较运算符（===）的行为基本一致，
    * 不同之处只有两个：一是 +0 不等于 -0，二是 NaN 等于自身。
    * */

    /*这个还有点用！！！！！
    *Object.assign()
    * Object.assign 方法用来将源对象（source）的所有可枚举属性，复制到目标对象（target）。它至少需要两个对象作为参数，第一个参数是目标对象，
    * 后面的参数都是源对象。只要有一个参数不是对象，就会抛出 TypeError 错误。
    * */
    var target = { a: 1 };

    var source1 = { b: 2 };
    var source2 = { c: 3 };
    Object.assign(target, source1, source2);
    console.log("target",target)
    /*Object.assign的作用*/
        //（1）为对象添加属性
    class Point {
        constructor(x, y) {
            Object.assign(this, {x, y});
        }
    }

    /*proto属性，用来读取或设置当前对象的 prototype 对象。尽量不使用这个方法很多浏览器不兼容*/
    var obj = new Object();
    console.log(obj)
    obj={
        __proto__: {},
        method: function() { }
    }
    console.log(obj)


    /*用来设置一个对象的 prototype 对象。它是 ES6 正式推荐的设置原型对象的方法。用这个啊！！我的朋友*/
    var o = Object.setPrototypeOf({}, null);
    console.log(o)
    /*Object.getPrototypeOf()*/

    /*一大块的Symbol*/
        /*Symbol的作用
        在 ES5 中，对象的属性名都是字符串，这容易造成属性名的冲突。
        比如，你使用了一个他人提供的对象，但又想为这个对象添加新的方法，
        新方法的名字有可能与现有方法产生冲突。如果有一种机制，保证每个属性的名字都是独一无二的就好了，
        这样就从根本上防止属性名的冲突。这就是 ES6 引入 Symbol 的原因。
        * */

        /*
        * ES6 引入了一种新的原始数据类型 Symbol，表示独一无二的 ID。它通过 Symbol 函数生成。
        * 这就是说，对象的属性名现在可以有两种类型，一种是原来就有的字符串，另一种就是新增的 Symbol 类型。
        * 凡是属性名属于 Symbol 类型，就都是独一无二的，可以保证不会与其他属性名产生冲突。
        * 注意symbol不能使用 new ，基本上你可以理解它为一种类似字符串的数据类型
        * */
        let s = Symbol("213");
        console.log("打印Symbol",s)

        /*我们可以为symbol中添加参数,此参数只用做打印输出*/

</script>
